import React from "react";
import Premade from "../storage/premade.json";

const ChoosePremade = ({handleClick, setChosen, setGame}) => {

    const handleGame = (id) => {
        handleClick(id);
        setChosen(true);
    }

    return(
        <>
            {
                Premade.map(room => {
                    return(
                        <div id={room.id} onClick={() => handleGame(e.target.id)} className="bg-blue-400 m-4 rounded h-20 w-64 justify-center items-center flex shadow-xl">
                            <h1 className="text-white justify-center items-center flex">Game {room.id}</h1>
                        </div>
                    )
                })
            }

        </>
    );
}

export default ChoosePremade;
